import axios from 'axios';
import { API } from '../config';

export const signup = (user) => {
  return axios({
    method: 'post',
    url: `${API}/signup`,
    data: user,
    headers: {
      Accept: 'application/json',
      'Content-Type': 'application/json'
    },
  })
  .then((resp) => resp.data)
  .catch((err) => console.log(err));
}
